import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Menu } from "antd";
import logo_image from "../../img/nexpus_logo_ver2.0_green(40px).png";

const LangdingLayout = ({ children }) => {
  return (
    <div className="root">
      <div className="root_navbar">
        <div className="container">
          <a href="/" className="logo text-uppercase">
            <img src={logo_image} alt="Logo"></img>
            <p>NextPus</p>
          </a>
        </div>
      </div>
      <div>
        <Menu mode="horizontal">
          <Menu.Item>
            <Link href="/login">
              <a>로그인</a>
            </Link>
          </Menu.Item>
          <Menu.Item>
            <Link href="/profile">
              <a>회원가입</a>
            </Link>
          </Menu.Item>
        </Menu>
      </div>
      {children}
    </div>
  );
};

LangdingLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default LangdingLayout;
